import io from 'socket.io-client';

const socket = io.connect('http://192.168.1.105:5000/');

export const isLogin = () => {
  socket.emit('isLogin', '1234');
  socket.on('isLogin', ({ isLogin }) => {
    if (isLogin) {
      console.log(isLogin);
      return true;
    }
    console.log(isLogin);
    return false;
  });
};
